import "../styles/Footer.css";

function Footer() {
  return (
    <div>
      <div className="footer">
        <div className="leftSide">
          <h2>What happened</h2>
          <p></p>
        </div>
        <div className="rightSide">
          <div>about us</div>
          <div>my order</div>
          <div>my account</div>
          <div>help</div>
        </div>
      </div>
      <div className="source"> &copy; 2021 </div>
    </div>
  );
}

export default Footer;
